/**
 * List of full easings
 * @namespace TWEEN.Easing
 * @example
 * import {Tween, Easing} from 'es6-tween'
 *
 * // then set via new Tween({x:0}).to({x:100}, 1000).easing(Easing.Quadratic.InOut).start()
 */
declare const Easing: {
    Linear: {
        None(k: any): any;
    };
    Quadratic: {
        In(k: any): number;
        Out(k: any): number;
        InOut(k: any): number;
    };
    Cubic: {
        In(k: any): number;
        Out(k: any): number;
        InOut(k: any): number;
    };
    Quartic: {
        In(k: any): number;
        Out(k: any): number;
        InOut(k: any): number;
    };
    Quintic: {
        In(k: any): number;
        Out(k: any): number;
        InOut(k: any): number;
    };
    Sinusoidal: {
        In(k: any): number;
        Out(k: any): number;
        InOut(k: any): number;
    };
    Exponential: {
        In(k: any): number;
        Out(k: any): number;
        InOut(k: any): number;
    };
    Circular: {
        In(k: any): number;
        Out(k: any): number;
        InOut(k: any): number;
    };
    Elastic: {
        In(k: any): number;
        Out(k: any): number;
        InOut(k: any): number;
    };
    Back: {
        In(k: any): number;
        Out(k: any): number;
        InOut(k: any): number;
    };
    Bounce: {
        In(k: any): number;
        Out(k: any): number;
        InOut(k: any): number;
    };
    Stepped: {
        steps: (steps: any) => (k: any) => number;
    };
};
export default Easing;
